import { useState, useEffect } from 'react';

function App() {
	const [Showing, setShowing] = useState(false);
	const onClick = () => setShowing(!Showing);

	return (
		<div>
			<button>{Showing ? 'Hide' : 'Show'}</button>
		</div>
	);
}

export default App;
